import React from "react";
import UUID from "uuidjs";


const Slider = ({slides, next, prev}) => {




    return (
        <ul className="carousel-slider">
            {slides && slides instanceof Array && slides.map( slide => {
                <li key={UUID.genV1()}>{slide}</li>
            })}
        </ul>
    )
}

export default  Slider;
